export default function Topbar() {
    return (
        <div className="container-fluid">
            <div className="row">
                <div className="col-6 bg-dark p-2 d-flex justify-content-end">
                    <button className="btn btn-secondary mx-1">Log In</button>
                    <button className="btn btn-secondary mx-1">Sign Up</button>
                </div>
            </div>
        </div>
    )
}
